omationexercise.com/products\&quot;);\n//Get the details of each and every cart\nproductObj.provideAddToCartDetails().each($el =&gt; {\n  const productId = $el.attr(&#x27;data-product-id&#x27;);\n  if (targetProductID.includes(productId) &amp;&amp; !uniqueProductIds.has(productId)) {\n    uniqueProductIds.add(productId);\n    cy.wrap($el).first().click({\n      force: true\n    });\n    productObj.clickContinueLink();\n  }\n});&quot;,&quot;err&quot;:{},&quot;uuid&quot;:&quot;3078e620-7a01-437b-8c9f-4aa1ef229671&quot;,&quot;parentUUID&quot;:&quot;b02a8838-453a-4e5a-834c-c402ec0e30f5&quot;,&quot;isHook&quot;:false,&quot;skipped&quot;:false},{&quot;title&quot;:&quot;Should Change the quantity of the product in cart &quot;,&quot;fullTitle&quot;:&quot;Add to Cart and Quantity Management Should Change the quantity of the product in cart &quot;,&quot;timedOut&quot;:null,&quot;duration&quot;:11567,&quot;state&quot;:&quot;failed&quot;,&quot;speed&quot;:null,&quot;pass&quot;:false,&quot;fail&quot;:true,&quot;pending&quot;:false,&quot;context&quot;:&quot;[\n    {\n        \&quot;title\&quot;: \&quot;Failed screenshot\&quot;,\n        \&quot;value\&quot;: \&quot;data:image/png;base64, iVBORw0KGgoAAAANSUhEUgAABQAAAALQCAIAAABAH0oBAAAAAXNSR0IArs4c6QAAIABJREFUeJzs3Xlck1e+OP5P9oWEEEjYA0IU3BA3EFyxgrRYlUql43S6WUu9pd5baztO7XQbp0473eb769ixiLa1entrq3WptIpW3BFUQISKEhTCnkDIvuf5/ZEQAwQEBAH5vF/+QZ6c55zzPAmYT845n0O6dOnSjBkz/ALGA0IIob7zDxzTWH97qHuBEEIIIYTuoqnhOokgCIx+EUKo3zAARgghhBAaKcgY/SKEEEIIIYQQGg3IQ90BhBBCCCGEEELofsAAGCGEEEIIIYTQqIABMEIIIYQQQgihUQEDYIQQQgghhBBCowIGwAghhBBCCCGERgUMgBFCCCGEEEIIjQoYACOEEEIIIYQQGhUwAEYIIYQQQgghNCpgAIwQQgghhBBCaFTAABghhBBCCCGE0KiAATBCCCGEEEIIoVEBA2CEEEIIIYQQQqMCBsAIIYQQQgghhEYF6lB3ACGERiMWy8MvIJTD4ZHIpKHuC0IIIYTQSELYCI1G2dRQrddr+3ouBsAIIXS/sVge4nFT2hSy2toqwmYb6u4ghBBCCI0kJDKZ48EVj5siuXm1rzEwToFGCKH7zS8gtE0hU6uVGP0ihBBCCPUVYbOp1co2hcwvILSv52IAjBBC9xuHw9No1UPdC4QQQgihEUyjVXM4vL6ehVOg0QOFRqNzuF50BpNEwi93BgtB2ExGg0bdZjabeig2sl6LXl7UQCGRSTj2ixBCCCF0LwibrR+5VDAARg8O
